import React from "react";
import "./Content.css";

function Content({ content }) {
  return (
    <div>
      <li className="content" id={content.id}>
        <div className="content__name">{content.username}</div>
        <div className="content__title">{content.title}</div>
        <div className="content__createdAt">{content.creatAt}</div>
      </li>
    </div>
  );
}

export default Content;
